      if (isRefreshAmount === true) {
        this.requestData.bizContent.amount = Math.floor(Math.random() * 10000 + 1)
      }
    },
    handleEnvChange() {
      console.log("handleEnvChange:", this.env)
    },
    showHostedIframe(){
        if (this.responseBody===''|| !this.responseBody.hasOwnProperty('bizContent')){
          this.$message.error('获取paymentUrl失败');
          console.log('hasOwnProperty-bizContent:',this.responseBody.hasOwnProperty('bizContent'))
          return;
        }
      let bizContent = JSON.parse(this.responseBody.bizContent);
      if (!bizContent.hasOwnProperty('paymentUrl')){
        this.$message.error('获取paymentUrl失败');
        console.log('hasOwnProperty-paymentUrl:',bizContent.hasOwnProperty('paymentUrl'))
        return;
      }

      if (bizContent.paymentUrl === ''){
        this.$message.error('获取paymentUrl失败');
        return;
      }
      this.paymentUrl = bizContent.paymentUrl;
      console.log('this.paymentUrl', this.paymentUrl)

